import styled from "styled-components";



const ImgContainer = styled.div`
    position:relative;
    width:200px;
    height:250px;
    background-color:red;
    margin:20px;
    overflow:hidden;
    border-radius:5px;

    img{
      position:relative;
      width:100%;
      height:100%;
      background-position:center;
    }

    &:hover{
      cursor:pointer;
    }
`;



function AnimalControl({item}) {
  return (
      <ImgContainer>
        <img src={item.Image}/>
      </ImgContainer>
  )
}

export default AnimalControl;
